  ctx.beginPath()
  ctx.moveTo(x+0*cs+pet(d), y+17*cs+pet(d))
  ctx.lineTo(x+0*cs+pet(d), y+24*cs+pet(d))
  ctx.stroke()

  //6
  ctx.beginPath()
  ctx.moveTo(x+24*cs+pet(d), y+17*cs+pet(d))
