    ctx.lineTo(x+16*cs+pet(d), y+14*cs+pet(d))
    ctx.lineTo(x+18*cs+pet(d), y+16*cs+pet(d))
    ctx.stroke()
    x+= 1*W/24
    //9
    ctx.beginPath()
    ctx.moveTo(x+10*cs+pet(d), y+21*cs+pet(d))
    ctx.lineTo(x+10*cs+pet(d), y+17*cs+pet(d))
