  ctx.fillStyle = color
  x+= 3*W/24
  ctx.lineCap = "square"
  ctx.lineJoin = "bevel"
  let w = (16*W/24)/3, p = w/2
  let functions = shuffle(["traffic_lightAt","traffic_lightAt","stay_in_your_laneAt",
    "houseAt","swingAt","racetrackAt","uphillAt","traffic_lightAt","bridgeAt","dormerAt",
    "ladderAt","suburbsAt"])
  
  // top fill header rect
  ctx.beginPath()
