    window [functions[1]](x+14.5*W/24+pet(d), y+16*H/24+pet(d), 6*H/24+pet(d),color)
    window [functions[0]](x+17.7*W/24+pet(d), y+1*H/24+pet(d), 6*H/24+pet(d),color)
    ctx.beginPath()
