  let cx = x+W/2, cy = y+H/2, d = 0, angle = a
  
  //1
  ctx.beginPath()
  p = rotatePoint(x+11.0*W/24+pet(d), y+22.5*H/24+pet(d) ,cx,cy,angle)
  let saved_p = copyOf(p)
  ctx.moveTo(p[0],p[1])
