  ctx.beginPath()
  ctx.moveTo(x+20*W/24, y+14*H/24)
  cpx = x+20*W/24
  cpy = y+17*H/24
  ctx.quadraticCurveTo(cpx, cpy, x+20*W/24, y+17*H/24)
