      cpx = x+xi[8]*W/24
      cpy = y+13*H/24
      ctx.quadraticCurveTo(cpx, cpy, x+xi[7]*W/24, y+13*H/24)
      cpx = x+xi[6]*W/24
      cpy = y+13*H/24
