function starAt (x,y,W,color) {
  let canvas = document.getElementById("myCanvas");
  let ctx = canvas.getContext("2d");
  let H = W
  ctx.globalAlpha = document.getElementById("opacity").value/100
  let colors = getCurrentPalette()
  let mode = document.getElementById("mode").value
  let alpha = document.getElementById("opacity").value
  let pad = W/20 - pet(30)
  let points = randomPick([4,5,6,7,8,9,3])
  let savedF = ctx.strokeStyle
  ctx.fillStyle = colors[colors.length-1]

  let incs = (Math.PI* 1)/(points*2)
  let r1 = W/2.5, r2 = r1/randomPick([1.3,2,1.6,1.8,2.7,5])
  let a = 0, cx = x+W/2, cy = y+H/2
  let i = 1, maxp = points*4 +1
  ctx.beginPath()
  let x0 = cx + r1 * Math.cos(a),
      y0 = cy + r1 * Math.sin(a)
  ctx.beginPath()
  x0 = cx + r2 * Math.cos(a),
  y0 = cy + r2 * Math.sin(a)
  ctx.moveTo(x0,y0)
  for (; i < maxp; i++) {
    a += incs/2
    x0 = cx + r2 * Math.cos(a)
    y0 = cy + r2 * Math.sin(a)
    ctx.lineTo(x0,y0)
    a += incs/2
    x0 = cx + r1 * Math.cos(a)
    y0 = cy + r1 * Math.sin(a)
    ctx.lineTo(x0,y0)
  }
  ctx.closePath()
  ctx.fill()
  ctx.fillStyle = colors[0]
  a = 0
  ctx.beginPath()
  x0 = cx + r1 * Math.cos(a),
  y0 = cy + r1 * Math.sin(a)
  ctx.moveTo(x0,y0)
  i = 1
  for (; i < maxp; i++) {
    x0 = cx + r1 * Math.cos(a)
    y0 = cy + r1 * Math.sin(a)
    ctx.lineTo(x0,y0)
    a += incs/2
    x0 = cx + r2 * Math.cos(a)
    y0 = cy + r2 * Math.sin(a)
    ctx.lineTo(x0,y0)
    a += incs/2
    x0 = cx + r2 * Math.cos(a)
    y0 = cy + r2 * Math.sin(a)
    ctx.lineTo(x0,y0)
  }
  ctx.closePath()
  ctx.fill()
  ctx.fillStyle = savedF
  let name = randomPick(placenames_stars)
  ctx.font = "italic "+1.5*W/24+"pt Times New Roman"
  let w = ctx.measureText(name).width
  ctx.fillText(name, x+W/2-w/2, y+H - 1*W/24)
}

