function buffleheadsAt (x,y,W,color,INVERT) {
  let canvas = document.getElementById("myCanvas")
  let ctx = canvas.getContext("2d")
  let H = W, cpx, cpy, points = []
  let colors = shuffle(getCurrentPalette(true,13))
  ctx.lineWidth = 1 + document.getElementById("featuresize").value/50
  ctx.strokeStyle = color
  ctx.fillStyle = color
  ctx.lineCap = "square"
  ctx.lineJoin = "bevel"
  let lw = ctx.lineWidth
  let i = 0, r1 = W/24, r2 = W/48
  let xoff = W/5 + pet(W/4), yoff = W/5 + pet(W/4)
  ctx.globalAlpha /= 1.5
  let alpha = ctx.globalAlpha
  let n = 0
  ctx.save()
  ctx.beginPath()
  ctx.moveTo(x,y)
  ctx.lineTo(x+W,y)
  ctx.lineTo(x+W,y+H)
  ctx.lineTo(x,y+H)
  ctx.lineTo(x,y)
  ctx.closePath()
  ctx.clip()
  let max = 7
  for (; n < 2; n++) {
    ctx.lineWidth = lw
    r1 = W/24, r2 = W/48
    ctx.globalAlpha = alpha
    i = 0
    for (; i < max; i++) {
      ctx.beginPath()
      ctx.ellipse(x+xoff,y+yoff,r1,r2,0,0,Math.PI*2)
      ctx.closePath()
      ctx.stroke()
      r1*=1.8
      r2*=1.8
      ctx.lineWidth *= 1.5
      ctx.globalAlpha *= 0.7
    }
    xoff = W - xoff
    yoff = H - yoff
  }
  ctx.restore()
  ctx.lineWidth = lw
  ctx.globalAlpha *= 1.5
}

