        cpy = y+4*H/24+pet(d)
        ctx.quadraticCurveTo(cpx, cpy, x+2*W/24+pet(d), y+12*H/24+pet(d))
        cpx = x+2*W/24+pet(d)
        cpy = y+21*H/24+pet(d)
        ctx.quadraticCurveTo(cpx, cpy, x+12*W/24, y+24*H/24)
