function ramenAt (x,y,W,color) {
  let canvas = document.getElementById("myCanvas")
  let ctx = canvas.getContext("2d")
  let H = W, cpx, cpy, points = []
  let colors = shuffle(getCurrentPalette(true,13))
  ctx.lineWidth = 1 + document.getElementById("featuresize").value/50
  ctx.strokeStyle = color
  ctx.lineCap = "square"
  ctx.lineJoin = "bevel"

  //1
  ctx.save()
  ctx.beginPath()
  ctx.moveTo(x+0.25*W/24, y+0.25*H/24)
  ctx.lineTo(x+23*W/24, y+0.25*H/24)
  ctx.lineTo(x+23*W/24, y+22.5*H/24)
  ctx.lineTo(x+0.25*W/24, y+22.5*H/24)
  ctx.lineTo(x+0.25*W/24, y+0.25*H/24)
  ctx.closePath()

  ctx.clip()

  let i = 0, j = 0, d = W/60, 
  x0 = x, y0 = y
  //1
  let S = 48
  for (; j < 6; j++) {
    x = x0
    ctx.beginPath()
    ctx.moveTo(x+1*W/S, y+8*H/S)
    i = 0
    for (; i < 14; i++) {
      cpx = x+1*W/S+pet(d)
      cpy = y+9*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+2*W/S+pet(d), y+9*H/S+pet(d))
      cpx = x+3*W/S+pet(d)
      cpy = y+9*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+3*W/S+pet(d), y+8*H/S+pet(d))
      cpx = x+3*W/S+pet(d)
      cpy = y+5*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+3*W/S+pet(d), y+2*H/S+pet(d))
      cpx = x+3*W/S+pet(d)
      cpy = y+1*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+4*W/S+pet(d), y+1*H/S+pet(d))
      cpx = x+5*W/S+pet(d)
      cpy = y+1*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+5*W/S+pet(d), y+2*H/S+pet(d))
      cpx = x+5*W/S+pet(d)
      cpy = y+5*H/S+pet(d)
      x += 4*W/60
    }
    ctx.stroke()
    y += 8*W/S
  }

  j = 0
  x0 -= W/S*2
  x = x0
  y0 += W/S*3
  y = y0
  for (; j < 5; j++) {
    x = x0
    ctx.beginPath()
    ctx.moveTo(x+1*W/S, y+8*H/S)
    i = 0
    for (; i < 15; i++) {
      cpx = x+1*W/S+pet(d)
      cpy = y+9*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+2*W/S+pet(d), y+9*H/S+pet(d))
      cpx = x+3*W/S+pet(d)
      cpy = y+9*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+3*W/S+pet(d), y+8*H/S+pet(d))
      cpx = x+3*W/S+pet(d)
      cpy = y+5*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+3*W/S+pet(d), y+2*H/S+pet(d))
      cpx = x+3*W/S+pet(d)
      cpy = y+1*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+4*W/S+pet(d), y+1*H/S+pet(d))
      cpx = x+5*W/S+pet(d)
      cpy = y+1*H/S+pet(d)
      ctx.quadraticCurveTo(cpx, cpy, x+5*W/S+pet(d), y+2*H/S+pet(d))
      cpx = x+5*W/S+pet(d)
      cpy = y+5*H/S+pet(d)
      x += 4*W/60
    }
    ctx.stroke()
    y += 8*W/S
  }
  ctx.restore()
}

