  cpx = x+8*W/24
  cpy = y+16*H/24
  cp = rotatePoint(cpx,cpy,cx,cy,angle)
  p = rotatePoint(x+9*W/24, y+20*H/24,cx,cy,angle)
  ctx.quadraticCurveTo(cp[0],cp[1],p[0],p[1])
  ctx.stroke()

  //6
