  //2
  ctx.beginPath()
  ctx.moveTo(x+4*W/24, y+14*H/24)
  ctx.lineTo(x+20*W/24, y+14*H/24)
  ctx.lineTo(x+20*W/24, y+13*H/24)
  ctx.lineTo(x+4*W/24, y+13*H/24)
  ctx.lineTo(x+4*W/24, y+14*H/24)
  ctx.stroke()

  //3
  ctx.beginPath()
  ctx.moveTo(x+5*W/24, y+14*H/24)
