  ctx.beginPath()
  ctx.moveTo(x+2*W/24, y+2*H/24)
  ctx.lineTo(x+22*W/24, y+2*H/24)
  ctx.lineTo(x+22*W/24, y+22*H/24)
  ctx.lineTo(x+2*W/24, y+22*H/24)
  ctx.lineTo(x+2*W/24, y+2*H/24)
  ctx.fill()
  let fs = W/24 * 2
  ctx.font = "100 "+(fs)+"pt AmericanTypewriter,Courier"
