function wd () {
  let ws = 0, ws2 = 0
  let apik = "3045dd712ffe6e702e3245525ac7fa38"
  fetch('https://api.openweathermap.org/data/2.5/weather?q=mattapoisett&units=imperial&appid='+apik)
    .then(res => res.json())
    .then(data => {
      ws = data['wind']['deg']
      ws2 = data['wind']['speed']
      temp = data['main']['temp']
      cond = data['weather']
      WD = ws
      WS = Math.round(ws2)+ " mph"
      TEMP = temp
      CONDITIONS = cond[0].main
      //console.log(data)
    })
    .catch(err => alert(err))
}

