function morulaAt (x,y,W,color) {
  let canvas = document.getElementById("myCanvas")
  let ctx = canvas.getContext("2d")
  let H = W, cpx, cpy, points = []
  let colors = shuffle(getCurrentPalette(true,13))
  ctx.lineWidth = 1 + document.getElementById("featuresize").value/50
  ctx.strokeStyle = color
  ctx.lineCap = "square"
  ctx.lineJoin = "bevel"
  //1
  let r1 = W/2
  ctx.beginPath()
  ctx.arc(x+W/2, y+H/2, r1, 0, Math.PI*2)
  ctx.stroke()
  r1 *= 0.85
  ctx.beginPath()
  ctx.arc(x+W/2, y+H/2, r1, 0, Math.PI*2)
  ctx.stroke()

  r1 *= 0.35
  ctx.beginPath()
  ctx.arc(W/2, H/2, r1, 0, Math.PI*2)
 // ctx.stroke()
  let r2 = r1*1.7
  r1 *= 1.1
  let a = 0
  let inc = (Math.PI*2)/7
  let cx = W/2, cy = H/2
  let x2 = cx + r2 * Math.cos(a)
  let y2 = cy + r2 * Math.sin(a)

  let s = Math.PI * 1.65
  let e = Math.PI * 1.8 + Math.PI/1.7
  let i = 0
  ctx.beginPath()
  for (;i < 7; i++) {
    
    ctx.arc(x+x2, y+y2, r1, s, e)
    
    a += inc
    x2 = cx + r2 * Math.cos(a)
    y2 = cy + r2 * Math.sin(a)
    s += Math.PI/3.6
    e += Math.PI/3.6
  }
  ctx.closePath()
  ctx.stroke()
}

