    ctx.quadraticCurveTo(cp[0],cp[1],p[0],p[1])
    ctx.stroke()

    ///8 erase strokes below ==================
    ctx.globalAlpha = 0.4
    ctx.strokeStyle = savedF
    ctx.lineWidth *= 3
    //8
    ctx.beginPath()
    p = rotatePoint(x+23*W/24+pet(d), y+12*H/24+pet(d) ,cx,cy,angle)
