    ctx.stroke()

    //9
    ctx.beginPath()
    p = rotatePoint(x+23*W/24+pet(d), y+12*H/24+pet(d) ,cx,cy,angle)
    ctx.moveTo(p[0],p[1])
    cpx = x+21*W/24+pet(d)
